import React from 'react';
import './Prix.css';
import { TweenLite } from 'gsap';

let value = 23383;

// Prix View Component 
export default function ReturnPriX() {

 const obj = { value: 0 };

 React.useEffect(() => {

  let target = document.querySelector('.valueTarget');
  TweenLite.to('.valueTarget', 5, {
   value: 600,

   roundProps: { value: 0.01 },

   onUpdate: () => target.innerHTML = obj.value
  })

 }, []);

 return (
  <div className='wrp-prix-exchange'>
   <p className='valueTarget' id='valueTarget'></p>
  </div>
 );
};
